c..   we want  x^n * expand( 1/x^n *( (1-x^n) * dcoefs/(1-x) + sgg1) )
c..   where n=ncat3

      ncat3x=ncat3

c..   these are the coefficients of (1-x)^i in expand( (1-x^n)/(1-x)*dcoefs ):
      helpd=0.d0
      do i=0,ncat3x-1
         helpd(i) = -bininv(-ncat3x,i+1)*dcoefs3(1.d0,dlxm1,dlxm1**2
     &        ,dlxm1**3,dlxm1**4,dlxm1**5)
      enddo
      
