c..   this is  G(x) = sigma/xt^ncat3 :
      do k=0,nsoft(3,1)
         sum = 0.d0
         do i=0,k
            sum = sum + bininv(ncat3x,i) * (help(k-i) + helpd(k-i))
         enddo
         helpx(k) = sum
      enddo

      sgg3exp = 0.d0
      do i=0,nsoft(3,1)
         sgg3exp = sgg3exp + xm1**i * ( helpx(i) )
      enddo

      sgg3exp = xt**ncat3 * sgg3exp

      return
