C-{{{ function sgg3x0balbe(yy)

      real*8 function sgg3x0balbe(xin)
C
C
      implicit none
      integer i
      real*8 xin,xt,sub,den,xm1,sgg3exp,sgg3mtexp,balbe,c3ggx0
      include '../commons/common-expand.f'
      include '../commons/common-vars.f'
      include '../commons/common-errors.f'
      common/tmp/balbe

      xt = xin
      xm1 = 1.d0 - xt

c..   sub = -ln(xt) = -ln(1-xm1) = xm1 + xm1^2/2 + xm1^3/3 + ...
      sub = 0.d0
      do i=1,nsoft(3,1)
         den = 1.d0*i
         sub = sub + xm1**i/den
      enddo

      sgg3x0balbe = sgg3exp(xt) + sgg3mtexp(xt)
     &     - 9*c3ggx0( (mt/mh)**2 )*( sub + dlog(xt) )
     &     + (balbe-1.d0)*xm1**(nsoftmt(3,1)+1)*sgg3exp(0.d0)
      modified = 1

      return
      end

